  display: none;
}
@media screen and (min-width: 1309px) {
    .nav_title_right {
      display: block;
    }
  }

body h1 > span {
  text-transform: none;
  opacity: 0.5;
  font-weight: 300;
  font-size: 12px;
}
body input + label {
  position: fixed;
  top: 40px;
  right: 40px;
  height: 20px;
  width: 25px;
  z-index: 5;
}
body input + label span {
  position: absolute;
  width: 100%;
  height: 2px;
  top: 50%;
  margin-top: -1px;
  left: 0;
  display: block;
  background: #fff;
  transition: 0.5s;
}
body input + label span:first-child {
  top: 3px;
}
body input + label span:last-child {
  top: 17px;
}
body label:hover {
  cursor: pointer;
}
body input:checked + label span {
  opacity: 0;
  top: 50%;
}
body input:checked + label span:first-child {
  opacity: 1;
  transform: rotate(405deg);
}
body input:checked + label span:last-child {
  opacity: 1;
  transform: rotate(-405deg);
}




.hamburger {
  background: #142233;
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100px;
  z-index: 3;
  transition: 0.5s;
  transition-delay: 0.5s;
  overflow: hidden;
  display: none;
}
.hamburger ul {
  list-style: none;
  text-align: center;
  position: absolute;
  top: 20%;
  left: 20%;
  right: 20%;
}
.hamburger ul li {
  list-style: none;
  opacity: 0;
  transition: 0.5s;
  transition-delay: 0s;
}
.hamburger ul li a {
  text-decoration: none;
  text-transform: uppercase;
  color: #fff;
  font-weight: 700;
  font-family: sans-serif;
  display: block;
  padding: 30px;
}
body #burger:checked ~ .hamburger {
  height: 100%;
  transition-delay: 0s;
}
body #burger:checked ~ .hamburger ul li {
  opacity: 1;
  transition-delay: 0.5s;
}



/* Close Nav Bar */

.hamburger a:active ~ .hamburger {
  height: 0%;
  transition-delay: 0s;
}
.hamburger a:active ~ .hamburger ul li {
  opacity: 0;
  transition-delay: 0.5s;
}

